import React from "react";
import Avatar from '@mui/material/Avatar';
import Container from '@mui/material/Container';
import SpaIcon from '@mui/icons-material/Spa';
import { AppBar, Button, ButtonGroup, Box} from "@mui/material";
import { green} from '@mui/material/colors';
import AdbIcon from '@mui/icons-material/Adb';
export default function Navbar({ conBoton, color, funcionLogin }) {
    return (
        <AppBar position="static">
            <Container alignItems="center">
                <Box
                    display="flex"
                    justifyContent="center"
                    alignItems="center"
                    minHeight="10vh"
                >
                    <Avatar m={2} sx={{ bgcolor: green[600] }}><SpaIcon /></Avatar>
                    <ButtonGroup variant="contained" aria-label="outlined primary button group">
                <Button><a href="http://google.com">Plantas</a></Button>
                <Button><a href="https://plantasacuaticas.com.ar/paginas/tienda.html">Tienda</a></Button>
                <Button><a href="https://plantasacuaticas.com.ar/paginas/formulario.html">Contacto</a></Button>
            </ButtonGroup>
                </Box>
            
                
            <ul>
                <li>
                <a href="http://google.com">ir a google</a>
                </li>
                <li>
                    <a href="http://google.com">ir a google</a>
                </li>
                <li>
                    <a href="http://google.com">ir a google</a>
                </li>
                <li>
                    <a href="http://google.com">ir a google</a>
                </li>
            </ul>
            {conBoton ? <button onClick={() => funcionLogin()}>LOGIN</button> : null}
            </Container>
        </AppBar>


    );
}
